				["custom"] = "function(_,_,combatEvent,_,sourceGUID,sourceName,_,_,destGUID,destName,_,_,spellID)\n    local compTime = GetTime()\n    \n    -- died\n    if combatEvent == \"UNIT_DIED\" then\n        for index, value in pairs(aura_env.time) do\n            if destGUID == index then\n                aura_env.time[index] = nil\n                aura_env.count = aura_env.count - 1\n            end\n        end\n    end\n    \n    -- summoned\n    if combatEvent == \"SPELL_SUMMON\" and sourceGUID == aura_env.pguid then\n        if spellID == 193331 or spellID == 193332 then\n            aura_env.time[destGUID] = compTime\n            aura_env.count = aura_env.count + 1\n            return true\n        end\n    end\nend\n\n\n\n\n\n\n\n\n\n\n\n",
