l then\n            print(LastUpdateA..\" - A - \"..a7)\n        end\n        if b7 ~= nil then\n            print(LastUpdateB..\" - B - \"..b7)\n        end\n        ]]--\n        --return (string.format(\"%.2f\", calc13)..\"%% :: \"..string.format(\"%.2f\", calc14)..\"%%\"..\" :: Time: \"..rppm_A_13)\n        \n    end\nend\n\n\n\n\n\n",
