			["displayText"] = "%c",
			["customText"] = "function(...)\n    local time,_,p = ...\n    local cd = tonumber(time)-GetTime() or 0\n    \n    \n    \n    local now = GetTime()\n    local tkcCastTime = (2/(1+UnitSpellHaste(\"player\")/100))\n    local tkcWillBeCastAt = now + tkcCastTime\n    for _,demon in pairs(aura_env.demons) do\n        for id, detail in pairs(demon.units) do\n            local lifespan =  demon.lifespan\n            if (detail.dob+lifespan) < tkcWillBeCastAt then aura_env.RemoveDemon(id) end\n        end\n    end\n    \n    local count = aura_env.count or 0\n    local cooldownText = p or 0\n    \n    local abbr = function(num)\n        local n = string.len(floor(num))\n        local l = n <= 3 and '' or n <= 6 and 'K' or n <= 9 and 'M' or n <= 12 and 'B' or n <= 15 and 'T' or 'Q'\n        num = string.format(\"%.0f\",num/10^(math.floor((n-1)/3)*3))\n        local p = string.find(num,\"%.\") or 1\n        p = n <= 3 and p-1 or p == 2 and 4 or p == 3 and 4 or 3\n        return string.sub(num,0,p) .. l\n    end\n    local damage = aura_env.TotalDamage() or 0\n    \n    if tkcWillBeCastAt <= (aura_env.buff_gds.time+15) then\n        damage = damage*1.4\n    end\n    \n    if tkcWillBeCastAt <= (aura_env.buff_sh.time+30) then\n        local _,_,_,_,_,_,shExpires = UnitBuff(\"player\",GetSpellInfo(196098))\n        if shExpires and tkcWillBeCastAt <= shExpires then\n            damage = damage*1.2\n        end\n    end\n    \n    if tkcWillBeCastAt <= (aura_env.buff_ss.time+25) then\n        damage = damage*1.3\n    end\n    \n    WA_OOMM_TKCF_DAMAGE_RAW = damage\n    \n    damage = abbr(damage)\n    \n    WA_OOMM_TKCF_COUNT = count\n    WA_OOMM_TKCF_DAMAGE = damage\n    \n    \n    --local text = count .. \"\\n\\n\\n\" .. cooldownText .. \"\\n\\n\\n\" .. damage\n    return  \"\"\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["yOffset"] = 0,
